use zntg_jxweb;
CREATE TABLE `tg_ShopServiceSetting` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_id` varchar(50) NOT NULL COMMENT '店铺id',
  `shop_name` varchar(50) NOT NULL COMMENT '店铺名称',
  `shop_logo` varchar(100) DEFAULT NULL COMMENT '店铺logo',
  `setting_id` varchar(50) NOT NULL COMMENT '客服接待组id',
  `seller_id` varchar(50) DEFAULT NULL COMMENT '商户id(null:自营,非null:店铺)',
  `deleted` bit(1) DEFAULT b'0' COMMENT '是否已删除（0未删除，1已删除）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COMMENT='店铺（含自营）客服接待组配置表';


